import Homepage from './pages/Homepage';
import Projects from './pages/Projects';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

import './css/main.css'

function App() {
  return (
    <BrowserRouter>
        <Routes>
          <Route exact path='/' element={ <Homepage /> } />
          <Route path='/projects' element={ <Projects /> } />
        </Routes>
    </BrowserRouter>
  );
}

export default App;
